@Component({
  selector: 'app-root',
  templateUrl: './app.component.html',
  styleUrls: ['./app.component.css']
})

export class AppComponent {
  public title = 'Welcome, John Doe';
  public nameText = "Input Coming From App-Component!";
  public listenFromEmmitter = "";
}
